import React from "react";
import TwitterIcon from "@material-ui/icons/Twitter";
import FacebookIcon from "@material-ui/icons/Facebook";
import InstagramIcon from "@material-ui/icons/Instagram";
import EmailIcon from "@material-ui/icons/Email";
import LinkedInIcon from "@material-ui/icons/LinkedIn";
import { Grid } from "@material-ui/core";

function Footer() {
  return (
    <div
      style={{
        marginTop: "12%",
        height: "400px",
        width: "100%",
        backgroundColor: "darkgreen",
        color: "white",
      }}
    >
      <h2 style={{ textAlign: "center" }}>ABOUS AS</h2>
      <br />
      <Grid container justify="center" style={{ marginTop: "11rem" }}>
        <TwitterIcon
          style={{ fontSize: "50px", marginRight: "3rem" }}
        ></TwitterIcon>
        <FacebookIcon
          style={{ fontSize: "50px", marginRight: "3rem" }}
        ></FacebookIcon>
        <InstagramIcon
          style={{ fontSize: "50px", marginRight: "3rem" }}
        ></InstagramIcon>
        <EmailIcon
          style={{ fontSize: "50px", marginRight: "3rem" }}
        ></EmailIcon>
        <LinkedInIcon
          style={{ fontSize: "50px", marginRight: "3rem" }}
        ></LinkedInIcon>
      </Grid>
      <div
        style={{
          textAlign: "center",
          fontSize: "20px",
          color: "white",
          marginTop: "3rem",
        }}
      >
        &copy; Code Republic 2021
      </div>
    </div>
  );
}

export default Footer;
